설계도 = ''
Month_name = ['JAN', 'FEB', 'MAR', 'APR', 'MAY', 'JUN', 'JUL', 'AUG', 'SEP', 'OCT', 'NOV', 'DEC']
Month_count = [31, 28, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31]
month = 0
day = 0

for i in 설계도:
    # 날짜 갱신
    day += 1
    # 날짜 정보 갱신
    over_count = int(Month_count[month])
    if over_count < day:
        day -= over_count
        month += 1

    # 설계도의 숫자를 보고 반복
    for j in range(int(i)):
        print(f'{Month_name[month]} {day}', end=' ')
